    false,nt"url": null,nt"notes": "Six subspecies of Canada geese (Branta
    canadensis) winter in and around the lower Columbia River Valley.  While the overall
    populations of 5 of these subspecies are doing well, the dusky Canada geese (B.
    c. occidentalis) have been declining since the mid-1970s (largely due to habitat
    changes caused by the 1964 Good Friday Earthquake that uplifted their nesting grounds).
     Because these subspecies intermix during winter and because they are often difficult
    to distinguish, hunting and control limitations are driven by the status of the
    dusky population.  Therefore it is important to track wintering areas and numbers.
     A large-scale effort across states and refuges has been implemented, and a banding
    program in Alaska is also in place.  Because JBH supports a small wintering population
    of dusky Canada geese, we have tracked wintering numbers and have contributed these
    data to the office of Migratory Birds.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
